import React from 'react';
import { createStackNavigator } from "@react-navigation/stack";
import { Ionicons } from '@expo/vector-icons';
import { TouchableOpacity } from 'react-native-gesture-handler';
import {HomeScreen} from '../ScreemFolder/OtherScreen';
import {ProfileScreen} from '../ScreemFolder/UserScreen';
import {
  ReadingScreen, 
  DetailStoryScreen,
} from '../ScreemFolder/StoryScreen'
import { CategoryDetail } from '../Components/CategoryComponent';

const HomeStack = createStackNavigator();
const HomeStackScreen = (props) => (
<HomeStack.Navigator mode="modal">
    <HomeStack.Screen 
      name="Home" 
      component={HomeScreen}
      options = {{
        title: 'Home',
        tabBarVisible: true,
        headerTitleAlign: 'center',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
        headerLeft: () => (
          <TouchableOpacity style={{flex:1}} onPress={()=> props.navigation.toggleDrawer()}>
            <Ionicons name='md-menu' size={50} color={'white'} style={{marginLeft: 10}}/>
          </TouchableOpacity>
        ),
        headerRight: () => (
          <TouchableOpacity style={{flex:1}} onPress={()=> props.navigation.navigate('DetailUser')}>
                <Ionicons name='ios-person' size={40} color={'white'} style={{marginRight:10}}/>
          </TouchableOpacity>
        )
       }}
    />  
    <HomeStack.Screen 
      name="DetailStory" 
      options = {{
        title: 'Detail story',
        tabBarVisible: true,
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff'
       }}
      component={DetailStoryScreen}
    />
    <HomeStack.Screen 
      name="Reading" 
      label= 'Reading' 
      component={ReadingScreen} 
      options={{
        tabBarVisible: false,
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
        headerRight: ()=> (
          <TouchableOpacity>
            <Ionicons name="md-menu" size={40} color="white" style={{marginRight: 20}}/>
          </TouchableOpacity>
        )
      }}
    />
    <HomeStack.Screen 
      name="DetailCategory" 
      options = {{
        title: 'Category story',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }} 
      component={CategoryDetail}/>
    <HomeStack.Screen 
      name="DetailUser" 
      options = {{
        title: '',
        headerStyle: {
          backgroundColor: '#8a2be2',
        },
        headerTintColor: '#fff',
       }}  
      component={ProfileScreen} 
    />
  </HomeStack.Navigator>
)
export {HomeStackScreen};
